import React from "react";

var year = new Date().getFullYear();

const Footer = () => {
    return (
        <>
            <div className=" text-center   fixed-bottom">
                <p className="t">Copyright ©️ {year}</p>
            </div>
        </>
    )
}
export default Footer;
